import './App.css';
import AppHeader from "./components/AppHeader";
import {
    Switch,
    Route,
    Link
} from "react-router-dom";
import Home from "./pages/Home";

function App() {

    return (
        <>
            <Switch>
                <Route path="/" exact>
                    <Home/>
                </Route>
                <Route path='*'>
                    <h1 className='text-center text-4xl mt-6'>Page Not Found 404</h1>
                </Route>
            </Switch>
        </>
    );
}

export default App;
